The Sarah Jane Adventures is a British science fiction television series, produced by BBC Cymru Wales for CBBC, created by Russell T Davies and starring Elisabeth Sladen. The programme is a spin-off of the long-running BBC science fiction programme Doctor Who and focuses on the adventures of investigative journalist and former companion of The Doctor, Sarah Jane Smith. The series debuted on BBC One with a 60-minute special, entitled &quot;Invasion of the Bane&quot;, on 1 January 2007. A full series of ten 25-minute episodes followed, beginning on 24 September 2007. The first series consisted of five two-part stories, and a second series, comprising six two-part stories, began airing on 29 September 2008. A third series, once again comprising of six two-part stories to make a total of twelve episodes, executively produced by Russell T Davies, started airing on 15 October 2009 and finished on 20 November 2009. A fourth series will begin airing on 11 October 2010 and fifth series has been confirmed by the BBC, which is scheduled to air in 2011.
The Sarah Jane Adventures was nominated for a British Academy Children's Award in 2008 in the Drama category, and once again in 2009 for a BAFTA Cymru, in Children's Drama.
